webpackJsonp([0xf80381db1cf0],{4026:function(e,t){e.exports={data:{challengeNode:{title:"Make Links Navigatable with HTML Access Keys",description:["HTML 提供<code>accesskey</code>属性，用于指定激活标签或者使标签获得焦点的快捷键，这可以使键盘用户的导航更加有效。","HTML5 允许在任何标签上使用这个属性。该属性对于交互类标签（如链接、按钮、表单控件等）十分有用。","举个例子：","<code>&lt;button accesskey=&quot;b&quot;&gt;Important Button&lt;/button&gt;</code>","<hr>",'Camper Cat 希望为他的两篇博客的标题的链接设置快捷键，以使用户可以快速导航到文章的全文。请为这两个链接添加<code>accesskey</code>属性，并将第一个设置为 "g"（表示 Garfield），第二个设置为 "c"（表示 Chuck Norris）。'],challengeType:0,fields:{slug:"/responsive-web-design/applied-accessibility/make-links-navigatable-with-html-access-keys",blockName:"Applied Accessibility",tests:[{text:'你应该为<code>id</code>是 "first" 的<code>a</code>标签添加<code>accesskey</code>属性。',testString:"assert($('#first').attr('accesskey'), '你应该为<code>id</code>是 \"first\" 的<code>a</code>标签添加<code>accesskey</code>属性。');"},{text:'你应该为<code>id</code>是 "second" 的<code>a</code>标签添加<code>accesskey</code>属性。',testString:"assert($('#second').attr('accesskey'), '你应该为<code>id</code>是 \"second\" 的<code>a</code>标签添加<code>accesskey</code>属性。');"},{text:'你应该将<code>id</code>是 "first" 的<code>a</code>标签的<code>accesskey</code>属性值设置为小写 "g"。',testString:"assert($('#first').attr('accesskey') == 'g', '你应该将<code>id</code>是 \"first\" 的<code>a</code>标签的<code>accesskey</code>属性值设置为小写 \"g\"。');"},{text:'你应该将<code>id</code>是 "second" 的<code>a</code>标签的<code>accesskey</code>属性值设置为小写 "c"。',testString:"assert($('#second').attr('accesskey') == 'c', '你应该将<code>id</code>是 \"second\" 的<code>a</code>标签的<code>accesskey</code>属性值设置为小写 \"c\"。')"}]},required:[],files:{indexhtml:{key:"indexhtml",ext:"html",name:"index",contents:'<body>\n  <header>\n    <h1>Deep Thoughts with Master Camper Cat</h1>\n  </header>\n  <article>\n    \n    \n    <h2><a id="first" href="">The Garfield Files: Lasagna as Training Fuel?</a></h2>\n    \n    \n    <p>The internet is littered with varying opinions on nutritional paradigms, from catnip paleo to hairball cleanses. But let\'s turn our attention to an often overlooked fitness fuel, and examine the protein-carb-NOM trifecta that is lasagna...</p>\n  </article>\n  <article>\n    \n    \n    <h2><a id="second" href="">Is Chuck Norris a Cat Person?</a></h2>\n    \n    \n    <p>Chuck Norris is widely regarded as the premier martial artist on the planet, and it\'s a complete coincidence anyone who disagrees with this fact mysteriously disappears soon after. But the real question is, is he a cat person?...</p>\n  </article>\n  <footer>&copy; 2016 Camper Cat</footer>\n</body>',head:"",tail:""},indexjs:null,indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/responsive-web-design/applied-accessibility/use-tabindex-to-add-keyboard-focus-to-an-element",id:"587d7790367417b2b2512aaf"},slug:"/responsive-web-design/applied-accessibility/make-links-navigatable-with-html-access-keys"}}}});
